import AssetsVolume from "./AssetsVolume";
import { assets } from "./data";

const Total = () => {
  const total = Object.keys(assets)
    .map((item) => AssetsVolume(assets[item]))
    .reduce((acc, item) => {
      return acc + item;
    }, 0);
  console.log(total);

  return total;
};

export default Total;
